import { types } from "mobx-state-tree";

const pokemon1=types.model({
        abilities:types.optional(types.array(abilitie),[]),
        sprites:types.optional(types.array(sprite),[]),
        id:types.string
})
const abilitie=types.model({
    ability: {
        name: types.string,
        url: types.string
    },
    is_hidden: false,
    slot: 1
})
const sprite=types.model({
    back_default:types.string,
    back_shiny:types.string,
    versions:{
        red_blue:color,
        yellow:color
    }
})
const color=types.model({
    back_default:types.string,
    front_default:types.string
})
export const pokemon=pokemon1.create()
